//Matrix Inversion Function using Lapacke
double Inv(double *A, unsigned n)
{
    int ipiv[n];
    double ret;

    ret =  LAPACKE_dgetrf(LAPACK_ROW_MAJOR, n, n, A, n, ipiv);

    if (ret !=0)
        return ret;

    ret = LAPACKE_dgetri(LAPACK_ROW_MAJOR, n, A, n, ipiv);

    return ret;
}

